export default {
    data() {
        return {
            count: 0
        };
    },
    methods: {
        setCountDefaultValue(defaultValue) {
            this.count = defaultValue;
        },
        incrementCount() {
            this.count++;
        },
        reduceCount() {
            this.count--;
        },
        doubleCount() {
            this.count *= 2;
        },
        halfCount() {
            this.count /= 2;
        },
    }
}
